// This file contains multiple audio files as base64 data URIs.
// You should scroll to the bottom and read the code that actually does stuff.

let soundEffects = {
    "Ding": new Audio("data:audio/mpeg;base64,"),
    "Order placed": new Audio("data:audio/mpeg;base64,"),
    "Order cancelled": new Audio("data:audio/mpeg;base64,"),
    "Order filled": new Audio("data:audio/mpeg;base64,"),
};

// Begin listening for messages from the content script
chrome.runtime.onMessage.addListener(onMessage);

// Runs when a message is received
async function onMessage(message) {
    // Play the Ding sound effect
    await soundEffects["Ding"].play();

    // Only continue if there is a sound effect for the message
    if (!soundEffects[message]) return;

    // Wait one second after the ding starts, then play the 
    // sound effect that corresponds to the message
    setTimeout(() => soundEffects[message].play(), 1000);
}